const Announcement = () => {
  return (
    <>
      <div className="custom_container">
        <div className="row">
          <div className="col-12">
            <ul className="d-flex align-content-center ApprovalDetailsPage_ul_top_div">
              <li>
                <NavLink to="/hr/dashboard">
                  <BsArrowLeft />
                </NavLink>
              </li>
              <li>
                <h3>Reimbursement</h3>
              </li>
            </ul>
          </div>
        </div>
      </div>
    </>
  );
};
export default Announcement;
